import React from 'react';

class SideTitle extends React.Component{
  constructor(props){
    super(props)
  }
  render(){
    return(
      <div>
        <div className="col-12 suggestitle">
          <div className="vl"></div>
            <h2 className="font-weight-bold">{this.props.h2}</h2>
            <h6>{this.props.h6}</h6>
        </div>
      </div>
    )
  }
}

export default ClassSuggesTitle
